import { Component, OnInit } from "@angular/core";
import { FormControl, FormGroup, Validators } from "@angular/forms";
import { ResetpasswordService } from "src/app/services/resetpassword.service";
import { Router } from "@angular/router";
import { ConnectionService } from "src/app/services/connection.service";
import { ToastrService } from "ngx-toastr";

@Component({
  selector: "app-resetpassword",
  templateUrl: "./resetpassword.component.html",
  styleUrls: ["./resetpassword.component.css"],
})
export class ResetpasswordComponent {
  isLoggedIn!: boolean;

  resetPassForm: FormGroup = new FormGroup({
    email: new FormControl("", [Validators.required, Validators.email]),
  });

  constructor(
    private resetPasswordService: ResetpasswordService,
    private router: Router,
    private connectionService: ConnectionService,
    private toastr: ToastrService
  ) {}

  ngOnInit(): void {
    this.connectionService.isUserLoggedIn$.subscribe(
      (loggedIn) => (this.isLoggedIn = loggedIn)
    );

    if (this.isLoggedIn == true) {
      this.router.navigate(["/accueil"]);
    }
  }

  submit() {
    if (this.resetPassForm.invalid) {
      if (this.resetPassForm.controls["email"].errors) {
        this.toastr.error("Adresse e-mail invalide", "Erreur");
      }

      return;
    }

    const value = this.resetPassForm.value;
    this.resetPasswordService.reset(value).subscribe((res) => {
      if (res.success) {
        this.router.navigate([res.redirectUrl]);
        this.toastr.success("Un mail a été envoyé à votre adresse", "");
      } else if (!res.success) {
        this.router.navigate([res.redirectUrl]);
        this.toastr.error(res.message, "");
      }
    });
  }
}
<app-navbar></app-navbar>

<div class="box">
  <form
    class="email-form"
    method="POST"
    [formGroup]="resetPassForm"
    (submit)="submit()"
  >
    <div class="reset-password-heading-bar">
      <h2 class="reset-password-heading">Trouvez votre compte</h2>
    </div>
    <br />
    <div class="reset-password-content">
      <p class="reset-password-text">
        Veuillez entrer votre e-mail pour rechercher votre compte
      </p>
      <input
        type="text"
        class="reset-password-input"
        id="email"
        name="email"
        placeholder="Adresse e-mail"
        formControlName="email"
        autofocus
      />
    </div>
    <div class="reset-password-actions">
      <a class="reset-password-cancel" routerLink="/log"><b> Annuler</b></a>
      <button type="submit" class="reset-password-submit">Envoyer</button>
    </div>
  </form>
</div>
